import logo from './logo.svg';

import './App.css';
import "../style/menu.css"

import "bootstrap/dist/css/bootstrap.min.css";


import Header from './components/Header';


function App() {
  return (
    <div className="App bg-dark text-light">
      <header>
        <Header />
      </header>
      <main>
      <p> Hello world</p>
      </main>
    </div>
  );
}

export default App;
